#could have been: 1) AUG - GCU - UAA, 2) AUG - GCU - UAG, 3) AUG - GCU, UGA,
#4) AUG - GCC - UAA, 5) AUG - GCC - UAG, 6) AUG - GCC, UGA,
#7) AUG - GCA - UAA, 8) AUG - GCA - UAG, 9) AUG - GCA, UGA,
