#Stop = 3 #will always need to be multiplied by 3


number_strings = {'F':2,'L':6,'S':6,'Y':2,'C':2,'W':1,'P':4,'H':2,'Q':2,'R':6,'I':3,'M':1,'T':4,'N':2,'K':2,'V':4,'A':4,'D':2,'E':2,'G':4}
s = ''



def extract_number_dif_strings(protein_string, dictionary):
    number_strings = []
    for i in protein_string:
        number_strings.append(dictionary[i])
    return number_strings

def number_RNA_strings(protein_string, dictionary):
    Output = 3
    for i in extract_number_dif_strings(protein_string, dictionary):
        Output *= i
    return Output%1000000

print(number_RNA_strings(s, number_strings))


